import React,{ Component } from 'react';
import axios from 'axios';
import styles from './Sources.module.css';
//import firebase from '../../Firebase';

class Sources extends Component { 

  clicked = (siteUrl) => {
    this.props.clicked(siteUrl)
  }


    render (){

      let itemsList = <tr></tr>;
        console.log(this.props)
        if(this.props.itemsList){
          itemsList = Object.keys(this.props.itemsList)
          .map(key => {
            let item = this.props.itemsList[key];
          return <tr key={key}>
                  <td onClick={()=>this.clicked(this.props.siteUrl)}>{item.siteName}</td>
                </tr>;
          });
        }

      return (
        <div>
          <table id={styles.customers}>
          <thead>
              <tr>
                  <th>Sources</th>
              </tr>
          </thead>
          <tbody>
            {itemsList}
          </tbody>
        </table>
        </div>
      );
      }
  //}
}

export default Sources;
